import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext"; // Asegúrate de que la ruta sea correcta

const AdminUsers = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const { token } = useAuth(); // Obtiene el token desde el contexto
  const navigate = useNavigate();

  useEffect(() => {
    if (!token) {
      navigate("/login"); // Redirige a login si no hay token
    } else {
      // Llama al backend para obtener los usuarios si el token es válido
      const fetchUsers = async () => {
        try {
          const response = await fetch("http://localhost:5000/auth/users1", {
            headers: {
              Authorization: `Bearer ${token}`,  // Asegúrate de que el token esté disponible
            },
          });

          if (!response.ok) {
            throw new Error(`Error fetching users: ${response.statusText}`);
          }

          const data = await response.json();
          setUsers(data);
        } catch (error) {
          console.error("Fetch error:", error.message);
        } finally {
          setLoading(false);
        }
      };

      fetchUsers();
    }
  }, [token, navigate]);

  const handleEdit = (userId) => {
    navigate(`/admin/users/edit/${userId}`); // Redirige a la vista de edición
  };

  const handleDelete = async (userId) => {
    try {
      const response = await fetch(`http://localhost:5000/api/users/${userId}`, {
        method: "DELETE",
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });

      if (!response.ok) {
        throw new Error("Error deleting user");
      }

      setUsers(users.filter((user) => user.id !== userId)); // Elimina el usuario de la lista
    } catch (error) {
      console.error(error);
    }
  };

  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      {/* Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <a className="navbar-brand" href="/">Admin Panel</a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
            aria-controls="navbarNav"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item">
                <a className="nav-link active" href="/admin/users">Usuarios</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="/admin/users/create">Crear Usuario</a>
              </li>
              <li className="nav-item">
                <a className="nav-link" href="/logout">Cerrar sesión</a>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      {/* Contenido principal */}
      <div className="container mt-4">
        <h2>Admin Users</h2>
        <table className="table table-bordered">
          <thead>
            <tr>
              <th>Username</th>
              <th>Email</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.length === 0 ? (
              <tr>
                <td colSpan="3">No users found</td>
              </tr>
            ) : (
              users.map((user) => (
                <tr key={user.id}>
                  <td>{user.username}</td>
                  <td>{user.email}</td>
                  <td>
                    <button
                      className="btn btn-primary"
                      onClick={() => handleEdit(user.id)}
                    >
                      Edit
                    </button>
                    <button
                      className="btn btn-danger ms-2"
                      onClick={() => handleDelete(user.id)}
                    >
                      Delete
                    </button>
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminUsers;
